import React, { useEffect, useState } from 'react';
import styles from './ManageRequests.module.css';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const ManageRequests = () => {
  const [requests, setRequests] = useState([]);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchRequests = async () => {
      try {
        const response = await axios.get('http://localhost:8080/requests/all');
        setRequests(response.data);
      } catch (err) {
        console.error('Error fetching requests:', err);
        setError('Failed to fetch requests.');
      }
    };

    fetchRequests();
  }, []);

  const handleViewDetails = (request) => {
    navigate(`/requestdetail/${request.requestId}`, { state: { request } });
  };

  return (
    <div className={styles.container}>
      <h3>Manage Service Requests</h3>
      {error && <p className={styles.errorMsg}>{error}</p>}
      {requests.length === 0 ? (
        <p>No requests found.</p>
      ) : (
        <table className={styles.table}>
          <thead>
            <tr>
              <th>ID</th>
              <th>User ID</th>
              <th>Service ID</th>
              <th>Status</th>
              <th>Created</th>
              <th>Action</th>
            </tr>
          </thead>
          <tbody>
            {requests.map((req) => (
              <tr key={req.requestId}>
                <td>{req.requestId}</td>
                <td>{req.userId}</td>
                <td>{req.serviceId}</td>
                <td>{req.status}</td>
                <td>{new Date(req.createDate).toLocaleString()}</td>
                <td>
                  <button
                    className={styles.viewBtn}
                    onClick={() => handleViewDetails(req)}
                  >
                    View
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default ManageRequests;
